import React from 'react';

const Navbar: React.FC = () => {
  return (
    <div style={{
      backgroundColor: 'white',
      padding: '1rem 2rem',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
      width: '100%',
      maxWidth: '1400px',
      borderRadius: '8px',
      position: 'relative',

    }}>
      <h1 style={{
        margin: 0,
        color: '#333',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>
        Paths
      </h1>

    </div>
  );
};

export default Navbar;
